INSERT INTO `item` (`id`, `numeroItem`, `descricaoSumaria`, `descricaoCompleta`, `descricaoPosLicitacao`, `unidadeMedida`, `marca`, `valorUnitario`, `quantidadeDisponivel`, `estoqueDisponivel`, `fabricante`, `fornecedor_id`, `subelemento_id`, `srp_id`) VALUES
(1, 1, 'ARMÁRIO DE COZINHA', 'ARMÁRIO DE COZINHA COM 5 (CINCO) PORTAS E 4 (QUATRO) GAVETAS. PUXADORES DE ALTA RESISTÊNCIA. ROLDANAS DESLIZANTES E PINTURA ELETROSTÁTICA.', 'Descrição Detalhada do Objeto Ofertado: ARMÁRIO DE COZINHA COM 5 (CINCO) PORTAS E 4 (QUATRO) GAVETAS. PUXADORES DE ALTA RESISTÊNCIA. ROLDANAS DESLIZANTES E PINTURA ELETROSTÁTICA.', 'UN ', 'itatiaia', 727.00, 1, 1, 'itatiaia', 1, 42, 1),
(2, 2, 'ARMÁRIO EM AÇO - 02 PORTAS - 1,74 X 1,2M', 'ESTRUTURA EM CHAPA DE AÇO; PINTURA ALTA RESISTÊNCIA EPOXI; 5 PRATELEIRAS REGULÁVEIS (SUPORTAM ENTRE 50 E 60 KG CADA); 2 PORTAS EM AÇO FECHAMENTO COM CHAVE; LARGURA 500MM - COMPRIMENTO 1200MM - ALTURA 1740MM ( VARIAÇÕES DE ATÉ 5% PARA MAIS OU PARA MENOS NAS MEDIDAS); PÉS NIVELADORES; GARANTIA DE 6 A 12 MESES.', 'Descrição Detalhada do Objeto Ofertado: ARMÁRIO EM AÇO - 02 PORTAS - 1,74 X 1,2M ESTRUTURA EM CHAPA DE AÇO; PINTURA ALTA RESISTÊNCIA EPOXI; 5 PRATELEIRAS REGULÁVEIS (SUPORTAM ENTRE 50 E 60 KG CADA); 2 PORTAS EM AÇO FECHAMENTO COM CHAVE; LARGURA 500MM - COMPRIMENTO 1200MM - ALTURA 1740MM ( VARIAÇÕES DE ATÉ 5% PARA MAIS OU PARA MENOS NAS MEDIDAS); PÉS NIVELADORES; GARANTIA DE 6 A 12 MESES.', 'UN ', 'W3 -Mod:A-413', 748.50, 5, 5, 'W3', 2, 42, 1),
(3, 3, 'ARMÁRIO EM AÇO - 02 PORTAS - 2.00 X 0,9M', 'ARMÁRIO DE AÇO, COM 02 PORTAS DE ABRIR, COM FECHADURA TIPO MAÇANETA CROMADA COM CHAVES, 04 PRATELEIRAS REGULÁVEIS, TODO CONFECCIONADO EM CHAPA 22, PINTURA EM ESMALTE SINTÉTICO NA COR BEGE OU CINZA E SECAGEM EM ESTUFA A 120º, MEDIDAS APROXIMADAS 2.00 X 0.90 X 0.45 M.(AXLXP)', 'Descrição Detalhada do Objeto Ofertado: ARMÁRIO DE AÇO, COM 02 PORTAS DE ABRIR, COM FECHADURA TIPO MAÇANETA CROMADA COM CHAVES, 04 PRATELEIRAS REGULÁVEIS, TODO CONFECCIONADO EM CHAPA 22, PINTURA EM ESMALTE SINTÉTICO NA COR BEGE OU CINZA E SECAGEM EM ESTUFA A 120º, MEDIDAS APROXIMADAS 2.00 X 0.90 X 0.45 M.(AXLXP)', 'UN ', 'W3 Mod:A-400', 578.00, 10, 10, 'W3', 2, 42, 1),
(4, 13, 'ARMÁRIO MADEIRA - ALTO', 'ARMÁRIO ALTO CONFECCIONADO EM MADEIRA AGLOMERADA DE 18 MM DE ESPESSURA MÍNIMA, MEDINDO 81X50X157 CM (MEDIDAS MÍNIMAS). REVESTIDO EM AMBAS A FACES EM MELAMÍNICO MARFIM DE BAIXA PRESSÃO (BP). PROVIDOS DE PORTAS DE ABRIR DE 02 FOLHAS EM AGLOMERADO DE 18 MM DE ESPESSURA MÍNIMA, REVESTIDO EM AMBAS AS FACES EM MELAMÍNICO NA COR MARFIM DE BAIXA PRESSÃO (BP), DOBRADIÇAS COM MOLA PROGRESSIVA PARA ABERTURA DE 110º (NO MÍNIMO),FECHADURA TIPO TAMBOR PARA TRAVAMENTO DO CONJUNTO, PROVIDAS DE MECANISMOS DE REGULAGEM, COM CHAVE PRINCIPAL E RESERVA. RODAPÉ COMPOSTO POR NIVELADORES INJETADOS EM NYLON. 03 PRATELEIRAS, EM AGLOMERADO DE 18 MM DE ESPESSURA MÍNIMA, REVESTIDO EM AMBAS AS FACES EM MELAMÍNICO NA COR MARFIM DE BAIXA PRESSÃO (BP). AS LATERAIS INTERNAS PROVIDAS DE FUROS MULTI-PONTOS PERMITINDO A REGULAGEM DAS PRATELEIRAS. ACABAMENTO NAS BORDAS E LATERAIS, NAS ÁREAS RETAS EM FITA ABS DE NO MÍNIMO 1 MM DE ESPESSURA NA COR ARGILA SEMI FOSCA COLADA.\nCONFORME ANEXO DO EDITAL - FOTOS DO MOBILIÁRIO', 'Descrição Detalhada do Objeto Ofertado: ARMÁRIO ALTO CONFECCIONADO EM MADEIRA AGLOMERADA DE 18 MM DE ESPESSURA MÍNIMA, MEDINDO 81X50X157 CM (MEDIDAS MÍNIMAS). REVESTIDO EM AMBAS A FACES EM MELAMÍNICO MARFIM DE BAIXA PRESSÃO (BP). PROVIDOS DE PORTAS DE ABRIR DE 02 FOLHAS EM AGLOMERADO DE 18 MM DE ESPESSURA MÍNIMA, REVESTIDO EM AMBAS AS FACES EM MELAMÍNICO NA COR MARFIM DE BAIXA PRESSÃO (BP), DOBRADIÇAS COM MOLA PROGRESSIVA PARA ABERTURA DE 110º (NO MÍNIMO),FECHADURA TIPO TAMBOR PARA TRAVAMENTO DO CONJUNTO, PROVIDAS DE MECANISMOS DE REGULAGEM, COM CHAVE PRINCIPAL E RESERVA. RODAPÉ COMPOSTO POR NIVELADORES INJETADOS EM NYLON. 03 PRATELEIRAS, EM AGLOMERADO DE 18 MM DE ESPESSURA MÍNIMA, REVESTIDO EM AMBAS AS FACES EM MELAMÍNICO NA COR MARFIM DE BAIXA PRESSÃO (BP). AS LATERAIS INTERNAS PROVIDAS DE FUROS MULTI-PONTOS PERMITINDO A REGULAGEM DAS PRATELEIRAS. ACABAMENTO NAS BORDAS E LATERAIS, NAS ÁREAS RETAS EM FITA ABS DE NO MÍNIMO 1 MM DE ESPESSURA NA COR ARGI