(7, 19, 'ESTAÇÃO DE TRABALHO 140 X 140 X 50 X 50 CM', 'ESTAÇÃO DE TRABALHO SIMPLES COMPOSTA 01 SUPERFÍCIE DE TRABALHO EM L COM DIAGONAL DE 1,04M E RAIO DE 0,25M (NO MÍNIMO), DESENHO ERGONÔMICO, MEDINDO 140 X 140 X 50 X 50 CM, COM ALTURA 74 CM (MEDIDAS MÍNIMAS). CONFECCIONADA EM AGLOMERADO CONTINUO DE NO MÍNIMO 25 MM, REVESTIMENTO EM MELAMINICO MARFIM DE BAIXA PRESSÃO EM AMBAS AS FACES. NA ÁREA DE TRABALHO, ATENDENDO NORMA NR 17 DO MINISTÉRIO DE TRABALHO,  DEVE POSSUI BORDAS ARREDONDADAS EM ERGOSOFT DE ALTO IMPACTO DE DUREZA MÍNIMA 95 SHORE E 25 MM DE ESPESSURA EM PVC ESTRUDADO, FORMATO EXTERNO EM SEMICÍRCULO DE 180O, CONJUGADO NAS EXTREMIDADES. MADEIRA E BORDA NA COR ARGILA E PÉ DE CANTO NA COR CINZA.\nNO VÉRTICE DO “L”, DEVERÁ POSSUIR CHANFRO EM 45º E PASSAGEM DE FIAÇÃO DE POLIPROPILENO COM DIVISÃO ENTRE LÓGICA E ELÉTRICA. \nESTRUTURA TIPO PAINEL. UNINDO OS PÉS DA ESTRUTURA, PAINÉIS HORIZONTAIS CONFECCIONADOS EM AGLOMERADO CONTÍNUO DE 25 MM DE ESPESSURA, COM REVESTIMENTO MELAMÍNICO MARFIM, DE BAIXA PRESSÃO EM AMBAS AS FACES, FIXADO ATRAVÉS DE SISTEMA DO TIPO MINI-FIX. ACABAMENTO EM TODAS AS BORDAS RETAS COM FITA DE ABS DE 1 MM DE ESPESSURA, NA COR ARGILA SEMI FOSCA COLADA. COM NIVELADORES INJETADOS EM NYLON. 01 GAVETEIRO FIXO À ESTRUTURA DA MESA, MEDINDO 32 CM DE LARGURA X 47 CM DE PROFUNDIDADE X 14 CM DE ALTURA (MEDIDAS MÍNIMAS), CONFECCIONADA EM AGLOMERADO DE 18 MM NO MÍNIMO, REVESTIDO EM MELAMÍNICO MARFIM, PROVIDO DE 02 GAVETAS, DEVERÁ POSSUIR TRILHO CORREDIÇO TELESCÓPICO EM AÇO COM ROLDANAS DUPLAS ESFÉRICAS, FECHADURA COM TRAVAMENTO DE TODO CONJUNTO, TIPO TAMBOR, COM CHAVE PRINCIPAL E RESERVA. ACABAMENTO EM TODAS AS BORDAS RETAS COM FITA DE ABS DE 1 MM DE ESPESSURA, NA COR ARGILA SEMI FOSCA COLADA. CONFORME ANEXO DO EDITAL - FOTOS DO MOBILIÁRIO - MADEIRA E BORDA NA COR ARGILA E PÉ DE CANTO NA COR CINZA.', 'Descrição Detalhada do Objeto Ofertado: ESTAÇÃO DE TRABALHO SIMPLES COMPOSTA 01 SUPERFÍCIE DE TRABALHO EM L COM DIAGONAL DE 1,04M E RAIO DE 0,25M (NO MÍNIMO), DESENHO ERGONÔMICO, MEDINDO 140 X 140 X 50 X 50 CM, COM ALTURA 74 CM (MEDIDAS MÍNIMAS). CONFECCIONADA EM AGLOMERADO CONTINUO DE NO MÍNIMO 25 MM, REVESTIMENTO EM MELAMINICO MARFIM DE BAIXA PRESSÃO EM AMBAS AS FACES. NA ÁREA DE TRABALHO, ATENDENDO NORMA NR 17 DO MINISTÉRIO DE TRABALHO, DEVE POSSUI BORDAS ARREDONDADAS EM ERGOSOFT DE ALTO IMPACTO DE DUREZA MÍNIMA 95 SHORE E 25 MM DE ESPESSURA EM PVC ESTRUDADO, FORMATO EXTERNO EM SEMICÍRCULO DE 180O, CONJUGADO NAS EXTREMIDADES. NO VÉRTICE DO “L”, DEVERÁ POSSUIR CHANFRO EM 45º E PASSAGEM DE FIAÇÃO DE POLIPROPILENO COM DIVISÃO ENTRE LÓGICA E ELÉTRICA. ESTRUTURA TIPO PAINEL. UNINDO OS PÉS DA ESTRUTURA, PAINÉIS HORIZONTAIS CONFECCIONADOS EM AGLOMERADO CONTÍNUO DE 25 MM DE ESPESSURA, COM REVESTIMENTO MELAMÍNICO MARFIM, DE BAIXA PRESSÃO EM AMBAS AS FACES, FIXADO ATRAVÉS DE SISTEMA DO TIPO MINI-FIX. ACABAMENTO EM TODAS AS BORDAS RETAS COM FITA DE ABS DE 1 MM DE ESPESSURA, NA COR ARGILA SEMI FOSCA COLADA. COM NIVELADORES INJETADOS EM NYLON. 01 GAVETEIRO FIXO À ESTRUTURA DA MESA, MEDINDO 32 CM DE LARGURA X 47 CM DE PROFUNDIDADE X 14 CM DE ALTURA (MEDIDAS MÍNIMAS), CONFECCIONADA EM AGLOMERADO DE 18 MM NO MÍNIMO, REVESTIDO EM MELAMÍNICO MARFIM, PROVIDO DE 02 GAVETAS, DEVERÁ POSSUIR TRILHO CORREDIÇO TELESCÓPICO EM AÇO COM ROLDANAS DUPLAS ESFÉRICAS, FECHADURA COM TRAVAMENTO DE TODO CONJUNTO, TIPO TAMBOR, COM CHAVE PRINCIPAL E RESERVA. ACABAMENTO EM TODAS AS BORDAS RETAS COM FITA DE ABS DE 1 MM DE ESPESSURA, NA COR ARGILA SEMI FOSCA COLADA. CONFORME ANEXO DO EDITAL MARCA DANNA, MODELO TK77238 - MADEIRA E BORDA NA COR ARGILA E PÉ DE CANTO NA COR CINZA.', 'UN ', 'DANNA', 298.60, 10, 10, 'DIM INDUSTRIA DE MÓVEIS LTDA', 5, 42, 1),
(8, 20, 'ESTAÇÃO DE TRABALHO 150 X 70 X 150 X 70 CM', 'ESTAÇÃO (MESA) DE TRABALHO COM SUPERFÍCIE EM “L”, TIPO DELTA. COM DIMENSÕES DE 1500MM X 700MM X 1500MM X 700MM, E RAIO INTERNO DE 250MM, E ALTURA TOTAL DA MESA DE 750MM. TAMPO CONFECCIONADO EM MDP MELAMINICO DE 25MM NA COR CINZA CRISTAL FOSCO EM AMBAS AS FACES, COM 3 FUROS PARA PASSA FIO. ACABAMENTO EXTERNO DA BORDA DO TAMPO EM FITA DE PVC 2MM REFILADO NA COR CINZA, E INTERNO EM PERFIL PVC MACIÇO 180º NA COR CINZA, COLADOS PELO PROCESSO HOT MELT. A FIXAÇÃO DO TAMPO À ESTRUTURA É FEITA ATRAVÉS DE BUCHAS ZAMAK CRAVADAS NO TAMPO E UNIDAS ATRAVÉS DE PARAFUSOS ROSQUEÁVEIS. (PODENDO MONTAR E DESMONTAR VÁRIAS VEZES). DUAS SAIAS EM MDP MELAMINICO DE 18MM NA COR CINZA CRISTAL FOSCO, COM ACABAMENTO DE BORDO EM FITA DE PVC 1MM NA COR CINZA CRISTAL, COLADA PELO PROCESSO HOT MELT. A FIXAÇÃO DAS SAIAS À ESTRUTURA É FEITA ATRAVÉS DE 04 PARAFUSOS ROSQUEÁVEIS E MINIFIX (SENDO 02 DE CADA LADO DOS PAINÉIS). ESTRUTURAS LATERAIS (PERNAS) FORMADAS POR TUBOS E CHAPAS METÁLICAS, COM A BASE SUPERIOR EM TUBO DE AÇO 20X30X1,2MM, E A BASE INFERIOR EM CHAPA DE AÇO REPUXADA CURVA, DISPENSANDO DESTA FORMA O USO DE PONTEIRAS DE PVC, COM ESPESSURA MÍNIMA DE 1,5MM, E A COLUNA DE SUSTENTAÇÃO COMPOSTA POR DOIS TUBOS OBLONGOS VERTICAIS PARALELOS, NA MEDIDA DE 55X30MM, DUAS CHAPAS (01 COM SAQUE LATERAL) E ESPESSURA MÍNIMA DE 0,6MM, FIXADAS AOS TUBOS, SENDO UMA INTERNA E FIXA, E A OUTRA EXTERNA E REMOVÍVEL, QUE POSSIBILITE A PASSAGEM DE CABOS POR DUTO VERTICAL INTERNO DO SOLO ATÉ O TAMPO DA MESA E CORTE MEIA LUA INFERIOR E SUPERIOR PARA PASSAGEM DE CABOS DE UMA MESA PARA OUTRA, ACABAMENTO COM SAPATAS NIVELADORAS EM NYLON INJETADO DE 60MM DE DIÂMETRO, CUJA FUNÇÃO SERÁ CONTORNAR EVENTUAIS DESNÍVEIS DE PISO. ESTRUTURA DE SUSTENTAÇÃO CENTRAL (PÉ DE CANTO) FORMADA POR TUBO METÁLICO, TENDO UMA 2 FUROS, SUPERIOR E INFERIOR, PARA PASSAGEM DE FIAÇÃO, ACABAMENTO COM SAPATAS NIVELADORAS EM NYLON INJETADO. TODA ESTRUTURA DE AÇO DA MESA SUBMETIDA A UM PRÉ-TRATAMENTO POR FOSFATIZAÇÃO (LAVAGEM-DECAPAGEM-FOSFATIZAÇÃO) E PINTURA ELETROSTÁTICA EM TINTA EPÓXI EM PÓ TEXTURIZADA NA COR CINZA, POLIMERIZADA EM ESTUFA A 220º C. GAVETEIRO FIXO DE DUAS GAVETAS, COM PUXADOR LATERAL MEDINDAS DO GAVETEIRO: 400X440X350MM CORPO E GAVETAS CONFECCIONADOS EM CHAPA METÁLICA DOBRADA COM ESPESSURA DE 0,6MM, TODA ESTRUTURA DE AÇO SÃO SUBMETIDOS A UM PRÉ-TRATAMENTO POR FOSFATIZAÇÃO A BASE DE ZINCO (LAVAGEM-DECAPAGEM-FOSFATIZAÇÃO) E PINTURA ELETROSTÁTICA EM TINTA EPÓXI EM PÓ TEXTURIZADA NA COR CINZA, POLIMERIZADA EM ESTUFA A 220º C. FRENTE CONFECCIONADA EM MDP MELAMÍNICO COM 18MM DE ESPESSURA, REVESTIDO EM AMBAS AS FACES NA COR CINZA. BORDAS DAS GAVETAS ACABADAS EM FITA DE PVC 2MM REFILADO NA COR CINZA, COLADAS PELO PROCESSO HOT MELT. FIXAÇÃO DO GAVETEIRO AO TAMPO DEVERÁ SE INTERNA, POR MEIO DE PARAFUSO DE AÇO. O GAVETEIRO É DOTADO DE FECHADURA FRONTAL COM TRAVA SIMULTÂNEA DAS GAVETAS E CHAVE EM DUPLICIDADE E AS MESMAS DESLIZAM SOBRE CORREDIÇAS METÁLICAS COM ROLDANAS GIRATÓRIAS DE NYLON.', 'Descrição Detalhada do Objeto Ofertado: ESTAÇÃO (MESA) DE TRABALHO COM SUPERFÍCIE EM “L”, TIPO DELTA. COM DIMENSÕES DE 1500MM X 700MM X 1500MM X 700MM, E RAIO INTERNO DE 250MM, E ALTURA TOTAL DA MESA DE 750MM. TAMPO CONFECCIONADO EM MDP MELAMINICO DE 25MM NA COR CINZA CRISTAL FOSCO EM AMBAS AS FACES, COM 3 FUROS PARA PASSA FIO. ACABAMENTO EXTERNO DA BORDA DO TAMPO EM FITA DE PVC 2MM REFILADO NA COR CINZA, E INTERNO EM PERFIL PVC MACIÇO 180º NA COR CINZA, COLADOS PELO PROCESSO HOT MELT. A FIXAÇÃO DO TAMPO À ESTRUTURA É FEITA ATRAVÉS DE BUCHAS ZAMAK CRAVADAS NO TAMPO E UNIDAS ATRAVÉS DE PARAFUSOS ROSQUEÁVEIS. (PODENDO MONTAR E DESMONTAR VÁRIAS VEZES). DUAS SAIAS EM MDP MELAMINICO DE 18MM NA COR CINZA CRISTAL FOSCO, COM ACABAMENTO DE BORDO EM FITA DE PVC 1MM NA COR CINZA CRISTAL, COLADA PELO PROCESSO HOT MELT. A FIXAÇÃO DAS SAIAS À ESTRUTURA É FEITA ATRAVÉS DE 04 PARAFUSOS ROSQUEÁVEIS E MINIFIX (SENDO 02 DE CADA LADO DOS PAINÉIS). ESTRUTURAS LATERAIS (PERNAS) FORMADA