(10, 23, 'ESTANTE BIBLIOTECA DUPLA FACE', 'ESTANTE BIBLIOTECA DUPLA FACE BASE FECHADA, COR BEGE OU CINZA, COM 10 PRATELEIRAS GRADUAVEIS COM APARDORES LATERAIS MEDINDO APROXIMADAMENTE: 2.00X1.04X 0.55 CM, CONFECCIONADO EM AÇO SAECHAPA 20, APARADORES LATERIAS 1,50MM.', 'Descrição Detalhada do Objeto Ofertado: Estante Dupla Face com base inferior fechada, totalmente confeccionada em chapa de aço de baixo teor de carbono,com acabamento pelo sistema de tratamento químico da chapa (anti-ferruginoso e fosfatizante) e pintura através de sistema eletrostático a pó, com camada mínima de tinta de 70 micras. Contendo: 02 (duas) colunas laterais de sustentação confeccionadas em chapa nº 16 (1,50mm) com altura de 2,00 (dois) metros, permitindo encaixe das bandejas em passos de 0,6 cm pelo sistema de cremalheira. 01 (uma) base retangular fechada confeccionada em chapa nº 20 (0,90mm), com 01 (um) reforço interno em Omega soldado na base confeccionado também em chapa nº 20 (0,90mm), 02 (dois) anteparos laterais soldados a base com suporte para encaixe das colunas laterais. • 01 (uma) Travessa superior horizontal (chapéu) confeccionado em chapa nº 20 (0,90mm) dobrado em forma de ”U”, fixados as colunas através de 04 (quatro) parafusos com porcas em cada lado. 10 (dez) prateleiras com dimensões de 1,00 (um) metro de comprimento e 23,5 cm de profundidade, confeccionadas em chapa nº 22 (0,75mm), sistema de encaixe soldado nas laterais de cada prateleira, que permitem a união a 02 (dois) aparadores laterais com cantos arredondados, sem cantos vivos, arestas cortantes ou rebarbas pelo sistema de encaixe (sem parafusos). Dimensões: Altura: 2,00 (dois) metros, Largura: 1,03 metros, Profundidade: 55 cm.', 'UN ', 'Biccateca', 500.00, 20, 20, 'Wtec Móveis e Equipamentos Técnicos LTDA.', 6, 42, 1),
