(15, 2, 'ADAPTADOR DE REDE SEM FIO', 'Adaptador de rede sem fio (wireless) similar ou equivalente ao modelo TL-WN821N da marca TP-Link, com os seguintes requisitos mínimos: \n1. Interface tipo USB 2.0. \n2. Deve possuir botão QSS, antena interna. \n3. Deve suportar frequência de 2,4 a 2,4835 GHz e possuir EIRP <20dBm. \n4. Deve suportar no mínimo as tecnologias de modulação: DBPSK, DQPSK, CCK, OFDM, 16-QAM, 64-QAM. \n5. Deve suportar os padrões Wireless: IEEE 802.11n, IEEE 802.11g, IEEE 802.11b. \n6. Deve possuir taxa de sinal: 11n: Até 150Mbps (dinâmico); 11g: Até 54Mbps (dinâmico); 11b: Até 11Mbps (dinâmico). \n7. Deve suportar os modos Wireless: Ad-Hoc e Infra-estrutural. \n8. Deve suportar no mínimo os modelos de segurança wireless: - WEP de 64/128 bits, WPA/WPA2, WPA-PSK/WPA2-PSK, filtragem MAC Wireless. \n9. Deve ser compatível com os sistemas operacionais: Windows 7 (32/64 bits), Windows Vista (32/64 bits), Windows XP (32/64 bits) e Windows 2000. \n10. Devem acompanhar o adaptador: CD de recursos e guia de instalação rápida. \n11. Deve possuir garantia de no mínimo 1 ano a contar da data de recebimento do produto. ', 'ADAPTADOR DE REDE SEM FIO', 'UNIDADE', 'ver ata', 34.49, 4, 4, 'ver ata', 9, 17, 2),
