(18, 5, 'ALICATE DE CRIMPAR - CAT6', 'Alicate tipo profissional 8.5” (215mm) para crimpar conector modular Plug RJ45 (8X8) CAT5E e CAT6 blindado, RJ11 e RJ12 (6X2 / 6X4 / 6X6). Com catraca, cortador e decapador de cabo. O crimp do conector modular deve ser na lateral da ferramenta, não deve possuir crimp frontal. Deve ser similar ou equivalente ao modelo HT-2810R da marca Hanlong Tools ou WT-2810R da marca Seccon.', 'ALICATE DE CRIMPAR - CAT6', 'UNIDADE', 'Seccon', 138.00, 3, 3, 'Seccon', 12, 17, 2),
(19, 6, 'ALICATE DE INSERÇÃO - TIPO 1', 'Alicate de inserção (Punch Down), alicate fixador para Keystone e Patch Panel com as seguintes características: com regulagem de pressão, material resistente, ferramenta de inserção, tipo uso equipamento distribuição, cabos, aplicação: inserção cabo UTP em tomadas RJ-45 fêmea / Patch Panel. Componentes: lamina removível e alojamento guardar lâminas, material cabo PVC rígido. Características adicionais: com seleção alto / baixo impacto. Garantia de no mínimo 3 meses a partir da data de entrega do produto.', 'ALICATE DE INSERÇÃO - TIPO 1', 'UNIDADE', 'ver ata', 20.85, 5, 5, 'ver ata', 13, 17, 2),
(20, 7, 'ALICATE DE INSERÇÃO - TIPO 2', 'Alicate de inserção com aparador de rebarbas e impacto, para inserção de fios em Terminal Block do tipo IDC 110 e em Blocos de Telefonia com Engate Rápido, também conhecida como Punch Down M10. Deve possuir espátulas para retirar os fios do bloco e remover o próprio bloco do bastidor.', 'ALICATE DE INSERÇÃO - TIPO 2', 'UNIDADE', 'ver ata', 22.88, 5, 5, 'ver ata', 13, 17, 2),
