(23, 18, 'CABO DE REDE CAT6 ', 'Caixa de cabo de rede com no mínimo 305 metros categoria CAT 6 com as seguintes especificações mínimas:\n1. Compatível com os padrões de rede 10base-T/100base-TX/1000base-TX.\n2. Suporte a tráfego de rede gigabit 10/100/1000.\n3. Construção de U/UTP - 4 pares trançados compostos de condutores sólidos equivalente ou superior a cobre nu, 23 AWG, isolados em polietileno especial, na cor cinza claro, capa externa de PVC, com metragem equivalente ou superior a 305 metros, anti-chama, marcação seqüencial métrica decrescente que facilita a visualização da quantidade restante na caixa.\n4.  Deve atender as normas ANSI/TIA/EIA-568C.2 (Balanced Twisted Pair Cabling Components) e ISO/IEC11801.\n5. Os equipamentos não deverão conter substâncias perigosas como mercúrio (Hg), chumbo (Pb), cromo hexavalente (Cr(VI)), cádmio (Cd), bifenil polibromados (PBBs), éteres difenil-polibromados (PBDEs) em concentração acima da recomendada na diretiva RoHS (Restriction of Certain Hazardous Substances). 6. Produto deve ser similar ou equivalente ao modelo GIGALAN U/UTP 23AWGX4P CAT.6 CM CZ RoHS da marca Furukawa.', 'CABO DE REDE CAT6 ', 'CX 305 M', 'FURUKAWA CAT6 cz', 580.00, 20, 20, 'FURUKAWA', 15, 17, 2),
