(32, 44, 'CARTUCHO TONER IMPRESSORA LEXMARK X950DE AMARELO', 'Cartucho Toner Impressora Lexmark, cor AMARELO, referência impressora Lexmark X950DE, referência cartucho C950X2YG. Capacidade média de impressão de 22.000 páginas padrão em conformidade com norma ISO/IEC 19798. Deve estar impresso na embalagem do produto sua referência e descrição. Deve conter na embalagem ou em etiqueta dados do fabricante ou importador. Deve vir acompanhado de manual básico de instalação. Produto novo, com todas suas peças e componentes sem qualquer uso anterior. Fabricante deve possuir programa de recolhimento de produtos usados com retirada no local de uso, com todas as despesas custeadas pela fabricante. O produto deve ser original do fabricante da impressora ou homologado pelo fabricante.', 'CARTUCHO TONER IMPRESSORA LEXMARK X950DE AMARELO', 'UNIDADE', 'ver ata', 1761.00, 25, 25, 'ver ata', 19, 17, 2),
