(34, 46, 'CARTUCHO TONER IMPRESSORA LEXMARK X950DE MAGENTA', 'Cartucho Toner Impressora Lexmark, cor MAGENTA, referência impressora Lexmark X950DE, referência cartucho C950X2MG. Capacidade média de impressão de 22.000 páginas padrão em conformidade com norma ISO/IEC 19798. Deve estar impresso na embalagem do produto sua referência e descrição. Deve conter na embalagem ou em etiqueta dados do fabricante ou importador. Deve vir acompanhado de manual básico de instalação. Produto novo, com todas suas peças e componentes sem qualquer uso anterior. Fabricante deve possuir programa de recolhimento de produtos usados com retirada no local de uso, com todas as despesas custeadas pela fabricante. O produto deve ser original do fabricante da impressora ou homologado pelo fabricante.', 'CARTUCHO TONER IMPRESSORA LEXMARK X950DE MAGENTA', 'UNIDADE', 'ver ata', 1350.00, 25, 25, 'ver ata', 21, 17, 2),
(35, 47, 'CARTUCHO TONER IMPRESSORA LEXMARK X950DE PRETO', 'Cartucho Toner Impressora Lexmark, cor MAGENTA, referência impressora Lexmark X950DE, referência cartucho X950X2KG. Capacidade média de impressão de 32.000 páginas padrão em conformidade com norma ISO/IEC 19798. Deve estar impresso na embalagem do produto sua referência e descrição. Deve conter na embalagem ou em etiqueta dados do fabricante ou importador. Deve vir acompanhado de manual básico de instalação. Produto novo, com todas suas peças e componentes sem qualquer uso anterior. Fabricante deve possuir programa de recolhimento de produtos usados com retirada no local de uso, com todas as despesas custeadas pela fabricante. O produto deve ser original do fabricante da impressora ou homologado pelo fabricante.', 'CARTUCHO TONER IMPRESSORA LEXMARK X950DE PRETO', 'UNIDADE', 'ver ata', 580.00, 30, 30, 'ver ata', 22, 17, 2),
(36, 57, 'CASE PARA HD', 'Case/Gaveta Disco Rígido, tipo externa com interface, tipo porta USB 2.0, aplicação HD de 3,5 pol, IDE Sata.', 'CASE PARA HD', 'UNIDADE', 'ver ata', 85.00, 7, 7, 'ver ata', 10, 17, 2),
(37, 60, 'CONECTOR RJ45 - FÊMEA - CAT 5E', 'Conector fêmea RJ-45 categoria CAT 5E, possuir corpo equivalente ou superior a termoplástico de alto impacto não propagante à chama, vias de contato produzidas com material equivalente ou superior ao bronze fosforoso com camadas de níquel e ouro, montado em placa de circuito impresso dupla face, possibilitar a fixação de ícones de identificação, ter a possibilidade de crimpagem T568A e T568B, tipo Keystone, ser compatível com todos os Patch Panels descarregados, espelhos e tomadas, atender a norma ANSI/TIA/EIA-568B.2. Embalagem com 5 unidades.', 'CONECTOR RJ45 - FÊMEA - CAT 5E', 'CAIXA 05 UN ', 'Seccon', 13.90, 100, 100, 'Seccon', 12, 17, 2),
(38, 61, 'CONECTOR RJ45 - FÊMEA - CAT 6', 'Conector fêmea RJ-45 categoria CAT. 6, possuir corpo equivalente ou superior a termoplástico de alto impacto não propagante à chama, vias de contato produzidas com material equivalente ou superior ao bronze fosforoso com camadas de níquel e ouro, montado em placa de circuito impresso dupla face, possibilitar a fixação de ícones de identificação, ter a possibilidade de crimpagem T568A e T568B, tipo Keystone, ser compatível com todos os Patch Panels descarregados, espelhos e tomadas, atender a norma ANSI/TIA/EIA-568B.2. Embalagem com 05 unidades.', 'CONECTOR RJ45 - FÊMEA - CAT 6', 'CAIXA 05 UN ', 'Seccon', 18.00, 10, 10, 'Seccon', 12, 17, 2),
(39, 62, 'CONECTOR RJ45 - MACHO - CAT 5E', 'Conector RJ45.\nPossibilidade de crimpagem no padrão T568A e T568B.\nConector tipo macho.\nReferência conector RJ45.\nCor transparente.\nAtender cabos U/UTP CAT5E.\nAtender a norma ANSI/TIA/EIA-568B.2.\nQualidade similiar Furukawa ou AMP.\nPacote com 1000 unidades.', 'CONECTOR RJ45 - MACHO - CAT 5E', 'PACOTE 1000 UN ', 'ver ata', 190.00, 4, 4, 'ver ata', 13, 17, 2),
(40, 63, 'CONECTOR RJ45 - MACHO CAT 06', 'Conector RJ45.\nPossibilidade de crimpagem no padrão T568C.2.\nConector tipo macho.\nReferência conector RJ45.\nCor transparente.\nAtender cabos U/UTP CAT6. Diâmetro do condutor: de 26 a 22 AWG. Embalagem com código do produto, data de fabricação e contato do fabricante. Os produtos não deverão conter substâncias perigosas como mercúrio (Hg), chumbo (Pb), cromo hexavalente (Cr(VI)), cádmio (Cd), bifenil polibromados (PBBs), éteres difenil-polibromados (PBDEs) em concentração acima da recomendada na diretiva RoHS (Restriction of Certain Hazardous Substances). \nSimiliar ou equivalente ao CONECTOR MACHO CAT.6 PARA CABO SOLIDO da marca Furukawa. \nPacote com 50 unidades.', 'CONECTOR RJ45 - MACHO CAT 06', 'PACOTE 50 UNIDADES', 'ver ata', 53.98, 70, 70, 'ver ata', 13, 17, 2),
(41, 65, 'DISCO RÍGIDO 2TB', 'Disco rígido de 2 TB com as seguintes especificações:\n1. Capacidade de armazenamento: 2 TB;\n2. Interface sata III;\n3. Possuir memória cache, de, no mínimo, 64 MB;\n4. Velocidade de rotação de 7200 RPM;\n5. Possuir uma taxa anual de falhas menor que 1%;\n6. Possuir latência média de 4,16 ms, ou inferior;\n7. Possuir tempo de busca aleatória menor que 8.5 ms;\n8. Possuir NCQ (Native Command Queuing);\n9. A taxa média de leitura e gravação, deverá ser de, no minimo, 156 Mb/s;\n10. Possuir tempo de busca de gravação aleatória menor que 9.5 ms;\n11. A temperatura máxima em operação deverá ser de, no máximo, 60º C;\n12. A garantia do fabricante deverá ser, de no mínimo, 1 ano a contar da data de entrega do produto;', 'DISCO RÍGIDO 2TB', 'UNIDADE', 'ver ata', 337.00, 10, 10, 'ver ata', 9, 17, 2),
(42, 66, 'DISCO RÍGIDO MAGNÉTICO PARA SERVIDOR IBM X3500', 'Disco Rígido Hot Plug para Servidor de Rede, uso interno. Deve possuir tecnologia Hot-Swap. Capacidade 300GB, velocidade 15.000 RPM, padrão Serial Attached SCSI (SAS), 2,5 polegadas, taxa de transferência de 6 Gbits/s, deve vir com gaveta. Deve ser totalmente compatível com o servidor de rede marca IBM modelo X3500 comprovado através de documentação do fabricante do servidor. Produto novo, sem qualquer uso anterior. Deve possuir garantia mínima de 1 ano a partir da data de recebimento do produto.', 'DISCO RÍGIDO MAGNÉTICO PARA SERVIDOR IBM X3500', 'UNIDADE', 'ver ata', 903.99, 6, 6, 'ver ata', 23, 17, 2),
(43, 67, 'DISCO RÍGIDO REMOVÍVEL 1 TB', 'Disco rígido portátil. HD Externo. Capacidade de, no mínimo, 1TB; interface USB de alta velocidade (2.0 e 3.0); sem necessidade de fonte de energia externa; alimentação de energia direto da porta USB; Formatação: NTFS; compatível com USB 1.1; velocidade: 7.200 RPM, no mínimo; Buffer: 8 MB, no mínimo; taxa de transferência da interface USB: 480 Mbits/s, no mínimo; compatível com Windows 2000, XP, Vista, 7 e 8; deve possuir tecnologia Plug&Play; deve acompanhar: Cabo USB e Guia de Instalação; garantia mínima de 12 meses a contar da data de ateste do equipamento.', 'DISCO RÍGIDO REMOVÍVEL 1 TB', 'UNIDADE', 'ver ata', 252.45, 5, 5, 'ver ata', 9, 17, 2),
(44, 68, 'DISCO RÍGIDO REMOVÍVEL 2 TB', 'Disco rígido portátil. HD Externo. Capacidade: 2 TB, no mínimo; interface: 1 (uma) USB 2.0, compatível com USB 1.1, no mínimo; velocidade: 7.200 RPM, no mínimo; buffer: 8 MB, no mínimo; taxa de transferência da interface USB: 480 Mbits/s, no mínimo; Average Seek Time (tempo de busca): 10 ms ou menor; compatível com Windows 2000, XP e Vista, no mínimo; alimentação: 100 a 240 VAC. Devem acompanhar: cabo USB 2.0, CD-rom com driver para Windows Vista, XP e 2000, cabo e fonte (se necessários) de energia, manual / guia de instalação / guia de operação; garantia mínima de 12 (doze) meses, a contar da data de recebimento do equipamento.', 'DISCO RÍGIDO REMOVÍVEL 2 TB', 'UNIDADE', 'SEAGATE', 383.91, 15, 15, 'SEAGATE', 24, 17, 2),
(45, 69, 'DVD-RW', 'DVD RW COM AS SEGUINTES ESPECIFICAÇÕES: CAPACIDADE DE ARMAZENAMENTO (4700 MB e 120 MIN PARA VÍDEOS COM AÚDIO); VELOCIDADE DE GRAVAÇÃO DE 4X; A MÍDIA DEVERÁ APRESENTAR LOGOMARCA DA FABRICANTE EM SUA SUPERFICIE SUPERIOR; EMBALAGEM DEVE CONTER 25 UNIDADES.', 'DVD-RW', 'TUBO 25 UNIDADES', 'ver ata', 67.99, 2, 2, 'ver ata', 25, 17, 2),
(46, 70, 'FITA FLEXÍVEL - PRETO SOBRE BRANCO - 12MM - TZFX-231', 'Fita flexível rotuladora -12mm - preto sobre branco - TZFX-231, para o rotulador BROTHER PT7500 – PT7600, com 8 metros de comprimento. Garantia mínima de 3 meses a partir da data de recebimento do produto.', 'FITA FLEXÍVEL – PRETO SOBRE BRANCO – 12MM – TZFX-231', 'UNIDADE', 'ver ata', 66.00, 5, 5, 'ver ata', 21, 17, 2),
(47, 71, 'FITA FLEXÍVEL - PRETO SOBRE BRANCO - 24MM - TZFX-251', 'Fita flexível rotuladora -24mm - preto sobre branco - TZFX-251, PARA o rotulador BROTHER PT7500 – PT7600, com 8 metros de comprimento. Garantia mínima de 3 meses a partir da data de recebimento do produto. ', 'FITA FLEXÍVEL – PRETO SOBRE BRANCO – 24MM – TZFX-251', 'UNIDADE', 'ver ata', 99.97, 5, 5, 'ver ata', 26, 17, 2),
(48, 73, 'FITA IMPRESSORA CRACHÁ - RIBBON - TIPO 2', 'Fita impressora de crachá. Tipo Ribbon para impressora Datacard SP55 Plus. Equivalente com as características: código: YMCKT. Part Number: 534000-003. Capacidade de impressão: 500 impressões. Acompanha 1 cartão de limpeza (Isopropanol Cleaning Card). Acompanha 1 rolete de limpeza (Adhesive Cleaning Sleeve).\n', 'FITA IMPRESSORA CRACHÁ - RIBBON - TIPO 2', 'UNIDADE', 'ver ata', 334.00, 5, 5, 'ver ata', 27, 17, 2),
(49, 74, 'FONE DE OUVIDO', 'Headset, sistema acústico: semi-aberto\nTipo de ímã: neodímio\nPotência máxima de entrada: 500 MW\nDiâmetro da caixa acústica: 40 mm\nResposta de frequência dos fones de ouvido: 20 - 20.000HZ\nImpedância dos fones de ouvido: 32 Ohm\nSensibilidade dos fones de ouvido: 93DB\nResposta de frequência do microfone: 100 - 4.000HZ\nImpedância do microfone: 2,2k Ohm\nSensibilidade do microfone: -44DB\nCartucho do microfone: 4 mm conectividade\nComprimento do cabo: 2 m\nConector: USB\nTipo de cabo: cobre\nFunção mudo\nControle de volume\nSimilar Headset Philips SHG7980 ou Headset Microsoft Life Chat LX-3000 4 botões USB ou Logitech Headphone G330 Gaming 981-000176', 'FONE DE OUVIDO', 'UNIDADE', 'ver ata', 132.11, 30, 30, 'ver ata', 28, 17, 2),
(50, 75, 'FONTE DE ALIMENTAÇÃO - TIPO 1', 'Fonte de Alimentação, tipo redundante. Potência Nominal 920 W. Aplicação em servidor de rede. Deve ser similar ao IBM Part Number 44X0831. Deve ser totalmente compatível com o servidor IBM X3500. O produto deve ser novo, sem uso anterior de qualquer um de seus componentes.', 'FONTE DE ALIMENTAÇÃO - TIPO 1', 'UNIDADE', 'ver ata', 999.00, 4, 4, 'ver ata', 28, 17, 2),
(51, 80, 'FOTOCONDUTOR IMPRESSORA LEXMARK X950DE COLORIDO', 'Unidade fotocondutor para Impressoras Lexmark linha X95X. Código de referência do fotocondutor C950X73G. Referência impressora Lexmark X950DE. Rendimento de 115.000 páginas aproximadamente. Colorido, color C/M/Y. Embalagem com 03 unidades de fotocondutor. Deve estar impresso na embalagem do produto sua referência e descrição. Deve conter na embalagem ou em etiqueta dados do fabricante ou importador. Deve vir acompanhado de manual básico de instalação. Produto novo, com todas suas peças e componentes sem qualquer uso anterior. Fabricante deve possuir programa de recolhimento de produtos usados com retirada no local de uso, com todas as despesas custeadas pela fabricante. O produto deve ser original do fabricante da impressora ou homologado pelo fabricante.', 'FOTOCONDUTOR IMPRESSORA LEXMARK X950DE COLORIDO', 'UNIDADE', 'ver ata', 1940.00, 6, 6, 'ver ata', 22, 17, 2),
(52, 81, 'FOTOCONDUTOR IMPRESSORA LEXMARK X950DE PRETO', 'Unidade fotocondutor para Impressoras Lexmark linha X95X. Código de referência do fotocondutor C950X71G. Referência impressora Lexmark X950DE. Rendimento de 115.000 páginas aproximadamente. Cor Preta. Deve estar impresso na embalagem do produto sua referência e descrição. Deve conter na embalagem ou em etiqueta dados do fabricante ou importador. Deve vir acompanhado de manual básico de instalação. Produto novo, com todas suas peças e componentes sem qualquer uso anterior. Fabricante deve possuir programa de recolhimento de produtos usados com retirada no local de uso, com todas as despesas custeadas pela fabricante. O produto deve ser original do fabricante da impressora ou homologado pelo fabricante. ', 'FOTOCONDUTOR IMPRESSORA LEXMARK X950DE PRETO', 'UNIDADE', 'ver ata', 1000.00, 6, 6, 'ver ata', 22, 17, 2),
(53, 82, 'FOTOCONDUTOR PARA XEROX 5020 (CARTUCHO IMPRESSORA XEROX WORKCENTRE 5020)', 'Cartucho de impressão impressora Xerox Workcentre 5020; referência 101R00432; durabilidade média para impressão de 22000 páginas, cilindro original, componentes 100% novos, validade mínima de 12 meses a partir da data de entrega. Fabricante deve possuir programa de recolhimento de produtos usados com retirada no local de uso, com todas as despesas custeadas pela fabricante.', 'FOTOCONDUTOR PARA XEROX 5020 (CARTUCHO IMPRESSORA XEROX WORKCENTRE 5020)', 'UNIDADE', 'ver ata', 500.00, 2, 2, 'ver ata', 22, 17, 2);
