(54, 87, 'KIT MANUTENÇÃO ADF IMPRESSORA LEXMARK X950DE', 'Conjunto de manutenção ADF para Impressora Lexmark X950DE. Código de referência do kit 40X7530. Referência impressora Lexmark X950DE. Capacidade 200.000 páginas. Deve estar impresso na embalagem do produto sua referência e descrição. Deve conter na embalagem ou em etiqueta dados do fabricante ou importador. Deve vir acompanhado de manual básico de instalação. Produto novo, com todas suas peças e componentes sem qualquer uso anterior. O produto deve ser original do fabricante da impressora ou homologado pelo fabricante.', 'KIT MANUTENÇÃO ADF IMPRESSORA LEXMARK X950DE', 'UNIDADE', 'ver ata', 620.00, 5, 5, 'ver ata', 29, 17, 2),
(55, 90, 'KIT MANUTENÇÃO IMPRESSORA LEXMARK X950DE', 'Kit de manutenção para Impressora Lexmark X950DE. Código de referência do kit 40X7550. Referência impressora Lexmark X950DE. Capacidade 320.000 páginas. Deve estar impresso na embalagem do produto sua referência e descrição. Deve conter na embalagem ou em etiqueta dados do fabricante ou importador. Deve vir acompanhado de manual básico de instalação. Produto novo, com todas suas peças e componentes sem qualquer uso anterior. O produto deve ser original do fabricante da impressora ou homologado pelo fabricante.', 'KIT MANUTENÇÃO IMPRESSORA LEXMARK X950DE', 'UNIDADE', 'ver ata', 1690.00, 5, 5, 'ver ata', 29, 17, 2),
(56, 91, 'KIT TESTADOR DE CABOS MULTIFUNCIONAL', 'Kit testador de cabos com as seguintes especificações:\n1. Deve possibilitar teste das normas T568A, T568B, 10 Base-T de implementação automática e testes de cabos Token Ring.\n2. Deve realizar testes de cabos coaxiais UTP e STP.\n3. Deve realizar testes de integridade da rede e exame de configuração.\n4. Deve realizar testes de circuitos abertos/curtos-circuitos, ligações elétricas defeituosas, reversões e pares divididos.\n5. Deve realizar testes de continuidade da rede.\n6. Deve realizar rastreamento de ponto de curto/abertura do cabo.\n7. Deve receber sinais na rede ou cabo de telefone.\n8. Deve transmitir sinal para rede de destino e rastreamento de sentido do cabo.\n9. Deve detectar modos de linha de telefone: ideal, vibração ou usado (fora do gancho).\n10. Deve ser composto de: Transmissor (principal); Receptor; Caixa de correspondência (remota).\n11. Deve enviar tom nas na  frequência: 4Khz.\n12. Deve receber intervalo de frequência: 100Hz ~300Hz.\n13. A alimentação deve ser através de 2 Baterias de 9 Volts 6F 22.\n14. Deve ter garantia mínima de 12 meses a partir da data de recebimento do produto.\n15. O produto e todas suas peças e componentes devem ser novos.\n16. Deve ser similar ou equivalente ao modelo TX2000 da marca Multitoc.', 'KIT TESTADOR DE CABOS MULTIFUNCIONAL', 'UNIDADE', 'ver ata', 250.00, 4, 4, 'ver ata', 30, 17, 2),
(57, 92, 'LEITOR CÓDIGO DE BARRAS', 'Leitor de código de barras laser Modelo Honeywell Voyager 1250G ou equivalente, com as seguintes especificações mínimas:\n1. Detecção automática de interface.\n2. Deve possuir design ergonômico.\n3. Deve permitir a digitalização de códigos de barras com uma distância mínima de 13 milímetros à 447 milímetros de distância, ou superior.\n4. Padrão de leitura de feixe único.\n5. Ângulo de leitura horizontal de 30°.\n6. Contraste de impressão de no mínimo de 20% de diferença de refletância.\n7. Capacidade de ler simbologias no padrão Databar 1D e GS1.\n8. Temperatura de operação:  0°C(ou inferior) à 40°C (ou superior).\n9. Temperatura de armazenamento: -20°C (ou inferior) à 60°C (ou superior).\n10. Deve acompanhar driver de instalação.\n11. Deve possuir indicador de leitura sonoro.\n12. Deve possuir interface USB.\n13. Deve acompanhar suporte.\n14. Deve resistir a queda de no mínimo, 1,5 metros.\n15. Deve acompanhar suporte (base).\n16. Deve acompanhar cabo USB.\n17. Garantia mínima de 5 anos pelo fabricante.', 'LEITOR CÓDIGO DE BARRAS', 'UNIDADE', 'Compex - CPX2200', 335.00, 3, 3, 'Advancode', 31, 17, 2),
(58, 93, 'LEITOR DE CÓDIGO DE BARRAS SEM FIO', 'Leitor de código de barras laser sem fio com as seguintes especificações:\n1. Deve detecção e configuração automática de interface. \n2. Deve possuir design ergonômico.\n3. Deve permitir comunicação irrestritra (qualquer direção) de, no minimo, até 10 metros de distância com a base de comunicação.\n4. Deve se comunicar com a base utilizando o padrão Bluetooth v2.1 classe 2 ou comprovadamente superior.\n5. Velocidade de leitura deverá ser de 100 linhas por segundo ou superior.\n6. Padrão de leitura de feixe único.\n7. Ângulo de leitura horizontal de 30°.\n8. Contraste de impressão de no mínimo de 10% de diferença de refletância.\n9. Capacidade de ler simbologias no padrão databar 1D e GS1.\n10. Temperatura de operação: em processo de carregamento:  0°c(ou inferior) à 40°c (ou superior); sem estar em carregamento: :  0°c(ou inferior) à 50°c (ou superior).\n11. Temperatura de armazenamento com bateria: -5°c (ou inferior) à 35°c (ou superior).\n12. Deve acompanhar driver de instalação.\n13. Deve possuir indicador de leitura sonoro.\n14. Deve possuir as seguintes interfaces com o sistema hospedeiro: USB e teclado.\n15. Deve acompanhar suporte.\n16. A base deverá possuir função com sinal sonoro para localização do leitor, em caso de perda do mesmo.\n17. Deve resistir a queda de no mínimo, 1 metro.\n18. Deve acompanhar suporte (base).\n19. A bateria deverá ter uma duração de, no mínimo, 12 horas de utilização ou, no mínimo 45 mil leituras por carga.\n20. A recarga completa da bateria deverá ser de, no máximo, 4 horas.\n21. A substituição da bateria deverá ser feita sem o uso de ferramentas.\n22. O equipamento deverá ter garantia mínima de 3 anos pelo fabricante.\n23. A bateria deverá ter garantia mínima de 1 ano pelo fabricante.\n24. Deve ser similar ou equivalente ao modelo: Honeywell Voyager 1202G.\n', 'LEITOR DE CÓDIGO DE BARRAS SEM FIO', 'UNIDADE', 'ver ata', 1404.89, 4, 4, 'ver ata', 9, 17, 2),
(59, 94, 'LIMPADOR DE CONTATOS EM SPRAY', 'Limpa contato. Composto de destilado de petróleo e propelente. Canudo prolongador para lugares de difícil acesso. Altura: 20 cm. Canudo prolongador: 10 cm. Conteúdo: 300ml. Peso liquido: 209g', 'LIMPADOR DE CONTATOS EM SPRAY', 'FRASCO 300 ML', 'Mundial Prime', 9.98, 4, 4, 'Mundial Prime', 12, 17, 2),
(60, 95, 'LOCALIZADOR DE CABOS INDUTIVO', 'Kit Localizador de Cabos de Rede (UTP 4 pares) e de cabos de telefonia. Composto por amplificador indutivo que emita o som produzido pelo gerador de sinal fabricado com polímero de alto impacto, com peso aproximado de 120 grs e gerador de tom. Deve possuir indicadores led para indicar status de operação. Deve ser alimentado por bateria de 9V, com duração aproximada de 80 horas, que deve acompanhar o produto. Produto novo, com todas suas peças e componentes sem qualquer uso anterior.', 'LOCALIZADOR DE CABOS INDUTIVO', 'UNIDADE', 'ver ata', 108.50, 5, 5, 'ver ata', 13, 17, 2),
(61, 96, 'MEMÓRIA 4GB PARA SERVIDOR IBM X3500', 'Pente de Memória. Capacidade 4GB Tipo de barramento: DDR3 1333 MHz, referência PC3-10600, 49Y1406. Deve ser totalmente compatível com o servidor  IBM System X3500 comprovado através de documentação do fabricante. Produto novo com garantia de no mínimo 12 meses a contar da data de recebimento do produto.', 'MEMÓRIA 4GB PARA SERVIDOR IBM X3500', 'UNIDADE', 'ver ata', 219.00, 16, 16, 'ver ata', 32, 17, 2),
(62, 97, 'MEMÓRIA 8G DDR3 ', 'Memória RAM. Capacidade de armazenamento: 8GB. Tecnologia: PC3-10600 (1333mhz). Tensão de alimentação (VDD): 1,5 V. Tempo de 9-9-9. Arquitetura DDR-3. Transferência de quatro dados por ciclo de clock. Temperatura de operação: 0 a 85 ºC. Tipo de Burst: Interleave e Sequencial. Memória sem registro: (não ECC). Memória: DIMM. Freqüência: PC3-10600 CL = 9. Quantidade de pinos: 240. Quantidade de chips: 16 unidades, sendo 8 de cada lado. ', 'MEMÓRIA 8G DDR3 ', 'UNIDADE', 'MARKVISION - MODELO: MKV1333/8G', 246.00, 16, 16, 'MARKVISION', 33, 17, 2),
(63, 101, 'ORGANIZADOR DE CABOS EM ESPIRAL', 'Organizador de cabos/fios flexível espiral – 3/4", com as seguintes especificações: Tubo espiral para organização de fios; Formato de mangueira em espiral; Cor preta ou cinza; Autoextinguível (anti-chama); Diâmetro externo mínimo de 2cm; Deverá ser entregue em caixa contendo 25 metros do produto.', 'ORGANIZADOR DE CABOS EM ESPIRAL', 'UNIDADE', 'ver ata', 86.72, 16, 16, 'ver ata', 18, 17, 2),
