(65, 103, 'ORGANIZADOR DE CABOS PARA RACK', 'Organizador de cabos horizontal  fechado 1U, Descrição, 1. Deve ser confeccionado em aço; 2. Deve possuir acabamento em pintura epóxi de alta resistência a riscos e a corrosão na cor preta; 3. Deve possuir tampa frontal metálica removível; 4. Deve possuir abertura traseira, superior e inferior para passagem dos cabos; 5. Deve suportar alta densidade de cabos no mínimo 50%; 6. Deve possuir acomodadores de cabos; 7. Deve possuir aberturas para passagem de abraçadeira ou velcro para fixação dos cabos; 8. Deve possuir parafusos e arruelas para fixação; 9. Deve suportar  CAT.5e: 40, CAT.6, CAT.6ª; 10. Largura de 19”, 482 mm, conforme requisitos da norma ANSI/TIA/EIA-310D; 11. Profundidade 69 mm; 12. ALTURA  1U, 42 mm.', 'ORGANIZADOR DE CABOS PARA RACK', 'UNIDADE', 'ver ata', 18.30, 15, 15, 'ver ata', 13, 17, 2),
