(69, 109, 'PENDRIVE 32GB', 'Memória portátil, capacidade memória 32, interface USB 2.0, tipo pen drive, com velocidade de leitura equivalente ou superior a 3Mb/s, com velocidade de gravação equivalente ou superior a 5Mb/s, temperatura de operação de 0°C a 60°C, temperatura de armazenamento de -20°C a 85°C. Com tampa deslizante fixada ao equipamento. Deve ter garantia contra defeitos de materiais e fabricação por no mínimo 12 meses a contar da data de entrega do produto. Produto similar ou equivalente ao modelo DT101G2 32GB da marca Kingston.', 'PENDRIVE 32GB', 'UNIDADE', 'ver ata', 28.40, 50, 50, 'ver ata', 35, 17, 2),
(70, 110, 'PLACA DE REDE', 'Placa rede compatível com os padrões IEEE802.3, IEEE802.3U, IEEE802.3AB e IEEE802.3X, padrão PCI Express compatível com as especificações PCI Express X4, X8, e X16, velocidade transferência 10/100/1000 MBps, características adicionais com mínimo de 2 portas ethernet. Aplicação conexão de computadores à rede. Produto na caixa lacrada original. Devem acompanhar: espelho padrão para gabinete ATX, espelho suplementar para gabinete mini-ATX e CD-Rom de instalação de drivers. Garantia mínima 3 anos. ', 'PLACA DE REDE', 'UNIDADE', 'ver ata', 720.00, 10, 10, 'ver ata', 10, 17, 2),
(71, 116, 'TESTADOR DE CABO', 'Testador de cabos, com as seguintes especificações:\n1. Deve testar cabos montados com conectores RJ-11 2 vias, RJ-11 4 vias, RJ-11 6 vias, RJ-45 8 vias UTP, RJ-45 8 vias STP (Blindado, coaxial (BNC) e USB. Nos cabos RJ-45 possibilitar teste dos padrões EIA/TIA 568A, EIA/TIA 568B e Cross Over.\n2. Deve efetuar testes de transmissão e recepção de sinal desde o ponto do usuário (espelho/caixa de superfície) até o rack (patch panel).\n3. Deve possuir leds indicativos para um rápido diagnóstico visual do teste indicando:\n- transmissão dos fios nos cabos; - interpretação dos resultados; - carga da bateria.\n4. Deve possuir botão para ligar ao pressionar e desligamento automático após alguns segundos da conclusão dos testes.\n5. Deve ser fornecido na cor branca, com 8,5cm de largura, 14,3cm de comprimento e 2,5cm de altura.\n6. Deve possuir dois módulos distintos: módulo Master e módulo Remote, que tenham função conjunta na operação dos testes.\n7. Deve ser composto por um transmissor de sinal, um receptor de sinal, uma bateria, uma bolsa para transporte, um manual do produto e um certificado de garantia.\n8. Deve ter garantia mínima de 01 (um) ano após a partir da data de recebimento do produto.\n', 'TESTADOR DE CABO', 'UNIDADE', 'ver ata', 49.99, 2, 2, 'ver ata', 36, 17, 2),
